import { useParams  ,Route ,Switch } from "react-router-dom";
import Comments from '../components/comments/Comments';

const QuoteDetail = () =>{
    const params=useParams().quoteId;
    console.log(params);
    return (
        <div>
        <h1>Quotes Detail</h1>

    <Route path='/quotes/:quoteId/comments' exact>
        <Comments />
    </Route>
    </div>
    )

};
export default QuoteDetail;
